	<!-- CКРИПТ ТОЛЬКО ДЛЯ ГЛАВНОЙ -->

	<script>
		

		$(window).on('load', () => {

			$('.header-menu a').click(function(e) {
				e.preventDefault()
				let id = $(this).attr('href')
				$('html').animate({
					scrollTop: $(id).offset().top
				}, 1000);
				$('.mobile-menu').slideUp(600)
			})

			$('.mobile-menu .menu a').click(function(e) {
				e.preventDefault()
				let id = $(this).attr('href')
				$('html').animate({
					scrollTop: $(id).offset().top
				}, 2000);
				$('.mobile-menu').slideUp(600)
			})

			$('.preloader').fadeOut(800)

			let mainSigns = document.querySelectorAll('.main-title__sign svg path')

			mainSigns.forEach(item => {
				let length = item.getTotalLength()
				item.style.strokeDasharray = length; 
				item.style.strokeDashoffset = length;
			})


			let mainTitle = $('.main .main-title__text').text().split('')
			$('.main .main-title__text').text('')
			mainTitle.forEach(item => {
				$('.main .main-title__text').append('<span>'+item+'</span>')
			})


			let projectsTitle = $('.projects .main-title__text').text().split('')
			$('.projects .main-title__text').text('')
			projectsTitle.forEach(item => {
				$('.projects .main-title__text').append('<span>'+item+'</span>')
			})


			let strategyTitle = $('.strategy .main-title__text').text().split('')
			$('.strategy .main-title__text').text('')
			strategyTitle.forEach(item => {
				$('.strategy .main-title__text').append('<span>'+item+'</span>')
			})


			setTimeout(() => {
				$('.main .main-title__sign').addClass('show')
				$('.main .main-title__text span').map((index, item) => {
					setTimeout(() => {
						$(item).css({
							transform: 'none',
							opacity: 1,
						})
					}, index*60)
				})
			}, 1000)

			$(window).on('scroll', () => {
				let scroll = $(document).scrollTop()

				let strategy = $('.strategy .main-title').offset().top
				let projects = $('.projects .main-title').offset().top
				
				if(scroll > (strategy - ($(window).height()/1.5))) {
					$('.strategy .main-title__sign').addClass('show')
					$('.strategy .main-title__text span').map((index, item) => {
						setTimeout(() => {
							$(item).css({
								transform: 'none',
								opacity: 1,
							})
						}, index*60)
					})
				}

				if(scroll > (projects - ($(window).height()/1.5))) {
					$('.projects .main-title__sign').addClass('show')
					$('.projects .main-title__text span').map((index, item) => {
						setTimeout(() => {
							$(item).css({
								transform: 'none',
								opacity: 1,
							})
						}, index*60)
					})
				}
			})
		})
		
	</script>

